  const [posts, setPosts] = useState([]);
  useEffect(() => {
    console.log("feed rendered");
  });
  return (
    <div className="feed">
      <div className="feedWrapper">
        <Share />
        {Posts.map((p) => (
          <Post key={p.id} post={p} />
        ))}
      </div>
    </div>
  );
}
